import React, {Component} from "react";
import {Table} from "reactstrap";

export class Categories extends Component {
    render() {
        return(
            <div className='categories'>
                <Table dark>
                    <thead>
                    <tr>
                        <th>Title</th>
                        <th>Text</th>
                        <th>Category</th>
                    </tr>
                    </thead>
                    <tbody>
                    {recipes.map(recipe => (
                            <tr key={recipe.id}>
                                <td>{recipe.title}</td>
                                <td>{recipe.text}</td>
                                <td>{recipe.category}</td>
                            </tr>
                        )
                    )}
                    </tbody>
                </Table>
            </div>
        )
    }
}

export default Categories;
